import React from 'react';
import Header from './components/headercomps/Header';
import Meals from './components/Mealscomp/Meals';
import { CartProvider } from './components/CartProvider';
import './App.css';

function App() {
  return (
    <CartProvider>
      <Header />
      <Meals />
    </CartProvider>
  );
}

export default App;
